import * as o from "react";
import m from "../lib/IconBase.es.js";
import n from "../defs/Metronome.es.js";
const e = o.forwardRef((r, t) => /* @__PURE__ */ o.createElement(m, { ref: t, ...r, weights: n }));
e.displayName = "MetronomeIcon";
const s = e;
export {
  s as Metronome,
  e as MetronomeIcon
};
